import itertools; import math; import operator; import random; from bisect import *; from collections import deque, defaultdict, Counter, OrderedDict; from functools import reduce; from heapq import *; import unittest; from typing import List;
def get_sol(): return Solution()
class Solution:
    def smallestDistancePair(self, nums: List[int], k: int) -> int:
        def no_of_pair_with_at_most_d_diff(d):
            l,r=0,1
            res=0
            while r<n:
                while l<r and nums[r]-nums[l]>d:
                    l+=1
                res+=r-l
                r+=1
            return res

        # alternative
        # def no_of_pair_with_at_most_d_diff(d):
        #     res=0
        #     l,r=0,1
        #     while l<n:
        #         while r<n and (nums[r]-nums[l])<=d:
        #             r+=1
        #         res+=r-l-1 # '-1' because it calculates no of pair
        #         l+=1
        #     return res

        n=len(nums)
        nums.sort()
        lo,hi=0,nums[-1]-nums[0]
        while lo<=hi:
            mid=(lo+hi)//2
            cnt=no_of_pair_with_at_most_d_diff(mid)
            if cnt<k:
                lo=mid+1
            else:
                hi=mid-1
        return lo

class Solution2:
    def smallestDistancePair(self, nums: List[int], k: int) -> int:
        n=len(nums)
        nums.sort()
        mnHeap=[]
        for i in range(n):
            j=i+1
            if j<n:
                diff=nums[j]-nums[i]
                heappush(mnHeap,[diff,i,j])

        diff=None
        while k:
            diff,i,j=heappop(mnHeap)
            j+=1
            if j<n:
                newDiff=nums[j]-nums[i]
                heappush(mnHeap,[newDiff,i,j])
            k-=1
        return diff

